        function twoDigit(n) {
            return n > 9 ? """" + n : ""0"" + n;
        }
        function getTwoTimeDiff(start, end) {
            var startTime = new Date();
            var endTime = new Date();

            s = start.split(':');
            e = end.split(':');
       ");
                WriteLiteral(@"     startTime.setHours(s[0]);
